import React from 'react';
import axios from 'axios';
import Button from 'react-bootstrap/Button';
import FormGroup from 'react-bootstrap/FormGroup';
import Form from 'react-bootstrap/Form';



export default class FooterForm extends React.Component {
    render() {
        return (
            <div id="kickstart-register">
                <Form id="regform-final">
                <h1 id="reg-head"> Register </h1>
                <h4 id="reg-sub"> Your final chance to sign up with a chance to get a free voodoo crate </h4>
                    <Form.Group>
                        <Form.Control controlId="exampleForm.ControlSelect1" placeholder="Name"></Form.Control>
                    </Form.Group>
                    <Form.Group>
                        <Form.Control controlId="exampleForm.ControlSelect1" placeholder="Email" ></Form.Control>
                    </Form.Group>

                    <Button type="submit"> Submit </Button>
                </Form>
            </div>
        );
    }

};
